arr = str.split("\n")
arr2d = [list(x) for x in arr]

MX=len(arr)

dx=[0,-1,0,1]
dy=[1,0,-1,0]

def is_valid(i,j,char):
    return i>=0 and i<MX and j>=0 and j<MX and arr2d[i][j] == char
    

def get_area_peri(i,j,vis,peri,char):
    vis[(i,j)]=1
    area=1
    for k in range(4):
        newX=i+dx[k]
        newY=j+dy[k]
        if is_valid(newX,newY,char):
            peri[(newX,newY)]+=1
        if is_valid(newX,newY,char) and (newX,newY) not in vis:
            area+=get_area_peri(newX,newY,vis,peri,char)
    return area

vis={}
ans=0
for i in range(MX):
    for j in range(MX):
        if (i,j) not in vis:
            peri = defaultdict(int) 
            area = get_area_peri(i,j,vis,peri,arr2d[i][j])
            perimeter = count = sum(4 - value for key, value in peri.items())
            if area == 1:
                perimeter = 4
            ans+=area*perimeter

print(ans)
    